import axios from "axios";
import {appConstants} from "../constants/constant";

const API = 'http://localhost:8089';


export const putApplication = (apply) => {

    const putApplicationPromise = axios.put(`${API}/applications`, apply);
    console.log('putApplication');
    console.log(putApplicationPromise);

    return {
        type: appConstants.PUT_APPLICATION,
        payload: putApplicationPromise
    };
};

export const getApplication = (user_id) => {
    const getApplicationPromise = axios.get(`${API}/applications/${user_id}`, {withCredentials: true});

    return {
        type: appConstants.GET_APPLICATION,
        payload: getApplicationPromise
    };
};


export const putApplication2 = (id, roomnum) => {

    const putApplication2Promise = axios.put(`${API}/applications/${id}/${roomnum}`, apply);
    console.log('putApplication');
    console.log(putApplication2Promise);

    return {
        type: appConstants.PUT_APPLICATION2,
        payload: putApplication2Promise
    };
};
